import React from 'react';
import {Link} from 'react-router-dom';
const Menu = () => {
    return(
        <>
        <Link> About Us</Link>
        <Link> Contact Us</Link>
        <a href="/">About</a>
        <a href="/contact">Contact</a>
      </>
    );
}

export default Menu;
